import React, { Component } from 'react';
import { AppState, StyleSheet, View,  Alert} from 'react-native';
import { Text, Button } from 'react-native-elements';
import { StatusBar } from 'expo-status-bar';
import * as Linking from 'expo-linking';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';

const Stack = createStackNavigator();
const HomeScreen = ({ navigation }) => {
    return (
        <>
              <Button
        title="Go to Jane's profile"
        onPress={() =>
          navigation.navigate('Profile', { name: 'Jane' })
        }
      />

        </>


    );
  };
  const ProfileScreen = ({ navigation, route }) => {
    return <Text>aaa</Text>;
  };
  const PScreen = ({ navigation, route }) => {
    return <Text>aaa bbb</Text>;
  };
class Master extends Component {
    constructor(props) {
        super(props);
        this.state = { };
    }
    closeApp() {
        Linking.openURL('exp://exp.host');
        // Linking.openURL('exp://192.168.86.66:19000');
        // this.setState({dataEngineStatus:false});
    }
    render() {
        return (
        <View style={styles.container}>
            <NavigationContainer>
               <Stack.Navigator>
                    <Stack.Screen
                    name="Home"
                    component={HomeScreen}
                    options={{ title: 'Welcome' }}
                    />

                    <Stack.Screen name="Profile" component={ProfileScreen} />
                    <Stack.Screen name="P" component={PScreen} />
                </Stack.Navigator>


                </NavigationContainer>
                <Text h3 style={styles.title}>Suez.bid{this.props.version}</Text>
            <View style={styles.buttonContainer}>
                    <Button style={styles.buttonStyle} onPress={()=> {
                    this.setState({dataEngineStatus:'test-' + new Date()});
                    this.closeApp();
                    }} title="Close App" />
            </View>
            <View style={styles.buttonContainer}>
                <Button style={styles.buttonStyle} onPress={()=> {
                    this.props.parent.setState({module:true, camera:(this.state.camera) ? false : true});
                }} title="Switch Camera" />
            </View>
            <View style={styles.buttonContainer}>
                <Button style={styles.buttonStyle} onPress={()=> {
                    this.setState({module:true, camera:(this.state.camera) ? false : true});
                }} title="Switch Model" />
            </View>
            <StatusBar style="light" />
        </View>)
    }
}
export default Master;

const styles = StyleSheet.create({
    container: {
      flex: 1,
      color: 'blue',
      backgroundColor: 'transparent',
      // alignItems: 'center',
      // justifyContent: 'center',
      height: '100%',
      width: '100%',
      paddingTop: 40
    },
    title : {
      alignSelf:'center'
    },
    buttonContainer: {
      margin: 6,
    }
  });
